column4:
Stanford: I would study something that covered applying business models using new technology to old industries (real estate) but mostly I would try to make as many friends as possible. The knowledge learned will go stale if not maintained, which makes the alum network the most valuable/durable asset you are buying by attending Stanford or Harvard etc. This is one of those quality over quantity things, I can attest to that being from the 2nd largest school in the nation. Building a technology requires a lot of human assets and investor confidence. Investors offer confidence to the Stanford/Harvard alum when evaluating technologies, the assumption is they must be worth a look (the school already pre-screened them). 

If I were an investor I would surely do the same. As the technology builder, I can\'t help but wonder if changing my school\'s name would have changed investor\'s reactions when I say \&quot;Here is an inevitable technology that will open a billion dollar plus market\&quot;. With UCF on my resume, all I get is a goofy facial expression that says \&quot;You must have over estimated, or have no idea what you are talking about\&quot;. However, in the past year I have watched $35m be invested into two companies, separately developing Part A &amp; Part B of my technology. It is only a matter of time before someone figures out that the real magic happens when the two parts are combined. Hindsight being 20/20 I wonder how my decision not to attend a well named Boston school has affected real world outcomes. I don\'t believe the education at UCF was inferior in any way, but I do wonder, \&quot;How much difference does the name make?\&quot; 

So go to Stanford if you can, and make a lot of friends
